INSERT INTO `feeds` VALUES (1,1,'2018-12-20','Berita','Upacara dalam rangka memperingati hari Sumpah Pemuda ke 90','<span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">Senin, 29 Oktober 2018.</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">Upacara dalam rangka memperingati hari Sumpah Pemuda ke 90 hari ini dilaksanakan di Alun alun Jember dengan Inspektur Upacara Kapolres Jember.</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">Tema peringatan Sumpah pemuda \"Bangun Pemuda Satukan Indonesia\"</span><br style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\"><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">(Diskominfo)</span>','ihAEPhKd8rYQ9ww24vUjbJGHsxinoXrCcA8zWAKDsHPcXeeGujpRtqZErSrJ.jpeg','2018-11-29 12:16:44','2021-05-16 19:27:57',64,'',''),(2,1,'2018-12-20','Berita','MASTERPLAN DAN ROADMAP PEMBAGUNAN TEKNOLOGI IT','<p style=\"margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Fokus Grup Diskusi<br>MASTERPLAN DAN ROADMAP PEMBAGUNAN TEKNOLOGI IT</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">Jember, 11 Oktober 2018</p><p style=\"margin-top: 6px; margin-bottom: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\"><br></p><div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\"><p style=\"margin-bottom: 6px; font-family: inherit;\">Dinas Komunikasi dan Informatika Kabupaten Jember mengadakan Focus Grup Diskusi tentang Masterplan dan Roadmap Pembangunan Teknologi IT, dilaksanakan di Hotel Panorama Jember.<br>Hadir sebagai Narasumber Dr.Ir. Endroyono DEA dari Institut Teknologi Surabaya beserta Tim, Akademisi dari Unej, akademisi dari Poltek Jember, OPD se Kabupaten Jember dan seluruh aparatur di Diskominfo.<br>FGD ini dimaksud untuk merangkum dan menerima umpan balik keinginan Pemerintah Kabupaten Jember dalam mewujudkan Pembangunan Teknologi IT dan bisa diterapkan secara berkelanjutan.<br>(Diskominfo)</p></div>','aeDta2qG9D04bZsnVY2xYePMEMDqzITRON75GcBpThUmwnqlw1llgGLIp0TX.jpeg','2018-12-03 08:54:35','2021-05-16 02:19:09',85,'',''),(3,1,'2019-05-06','Agenda','ROADMAP','<p>tambah agenda</p>','JwsDVOMyimWe8ijQpWEWRK8xC6bN4EttcxLDH2vyKA28O4AvHWjDREjJK5NI.jpeg','2018-12-20 05:14:06','2021-05-16 06:56:32',145,NULL,NULL),(9,1,'2019-05-06','Berita','Pengajuan Hosting','<div><div>Alur Prosedur pengajuan Hosting :</div><div><br></div><ol><li>Pemohon mengajukan surat permohonan dan form( Form dapat diunduh <a href=\"http://diskominfo.jemberkab.go.id/files/formserver.pdf\" target=\"_blank\" style=\"color: rgb(255, 0, 0);\">disini</a><a href=\"http:///home/kominfoweb/profil/files/formserver.pdf\" target=\"_blank\"></a>);</li><li>Pemohon melengkapi dokumen pengajuan hosting yang telah terisi, ditandatangani dan diberi stempel :</li><li>Pemohon menyerahkan dokumen pengajuan hosting ke Dinas Komunikasi Dan Informatika Kab. Jember ( help.kominfojbr@gmail.com )</li><li>Helpdesk memeriksa dokumen pengajuan hosting</li><li>Jika dokumen lengkap maka proses dapat dilanjutkan, jika tidak maka pemohon wajib melengkapi dokumen pengajuan terlebih dahulu</li><li>Helpdesk memproses pengajuan hosting dan User / Pasword<br></li><li>Helpdesk memproses Berita Acara Akses User / Pasword untuk kepada pemohon</li><li>Helpdesk menginformasikan bahwa proses administrasi telah selesai</li><li>Helpdesk memberitahukan kepada pemohon bahwa hosting sudah tersedia</li><li>Proses selesai.</li></ol></div>','N6t9P96UdCWa4IbLjOdkMqHFn8o1HdJXdHw9dDbel7zgfzlNBJ34PXmwfKMX.jpeg','2019-02-26 09:04:25','2021-05-15 00:29:28',825,NULL,NULL),(10,1,'2019-03-06','Berita','Forum Dialog Publik  Pancasila, Jiwa dan Kepribadian Bangsa Indonesia .  dalam rangka mendukung penguatan pemahaman ideologi pancasila','<p>Berdasarkan hasil survey TEKNO PRENEUR ( Asosiasi&nbsp; Penyelenggara&nbsp; Jasa Internet&nbsp; Indonesia ), penetrasi pengguna internet adalah 54,68 % dari total populasi&nbsp; penduduk&nbsp; indonesia, atau&nbsp; 143,26 juta jiwa dari 262 juta penduduk Indonesia. Masyarakat saat ini dihadapkan pada banyaknya Informasi yang beredar (banjir informasi), dari informasi yang benar dan valid sampai berita hoaks. Hoaks yang bersifat bercanda, hingga provokasi, agitasi, dan propaganda.&nbsp;</p><p>Propaganda di medsos, adalah ancaman baru indonesia. Indonesia menghadapi ancaman baru yang DAHSYAT, bukan hanya tujuannya namun pada cara dan instrumennya. MENGAPA DAHSYAT ? ...Karena sasarannya besar, mampu mempengaruhi pikiran manusia (opini) secara masal, dalam waktu singkat, dengan biaya yang murah dan sulit dilacak.. Bukan hanya Indonesia namun banyak negara menghadapi hal yang sama, masing-masing mengadapi dengan bermacam-macam cara.&nbsp;<br></p><p>Bentuk Ancamannya seperti :&nbsp;<br></p><p>-<span style=\"white-space:pre\">	</span>PROVOKASI : Kegiatan untuk menyulut kebencian dan&nbsp; kemarahan.</p><p>-<span style=\"white-space:pre\">	</span>AGITASI : Hasutan kepada orang banyak (untuk mengadakan huru hara, pemberontakan dan sebagainya). Biasanya dilakukan oleh tokoh atau aktivis partai politik; pidato yang berapi-api untuk mempengaruhi massa.</p><p>-<span style=\"white-space:pre\">	</span>PROPAGANDA : Sebuah upaya disengaja dan sistematis untuk membentuk persepsi, memanipulasi alam pikiran atau kognisi, dan mempengaruhi langsung perilaku agar memberikan respon sesuai yang dikehendai pelaku propaganda</p><p>Tidak semua informasi dari media massa, terutama didunia maya dapat dipercaya. Masyarakat atau pembaca masih harus mengklarifikasi kebenaran informasi dari berbagai sumber Informasi. Untuk melakukan itu, masyarakat khususnya anak muda usia dibawah 30 tahun harus melek media atau memiliki kemampuan kesadaran memahami fakta dan asal mula informasi yang diperoleh. Dengan menjadi melek media, pembaca diharapakan semakin kritis dalam mengolah informasi. .<span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">Pernyatan itu ditegaskan&nbsp;</span><font color=\"#1d2129\" face=\"Helvetica, Arial, sans-serif\">Ibu Siti Meiningsih ( Direktur Pengelolaan Media Ditjen Informasi dan Komunikasi Publik Kemenkominfo ).</font><br></p><p><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">Pada Hari Jumat tanggal 1 Maret 2019 </span><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">yang bertempat di&nbsp;</span><font color=\"#1d2129\" face=\"Helvetica, Arial, sans-serif\">Halaman Pondok Pesantren An-Nur Kesilir, Kec Wuluhan. D</font><font color=\"#1d2129\" face=\"Helvetica, Arial, sans-serif\">i&nbsp;</font><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">depan ratusan masyarakat Kecamatan Wuuhan,&nbsp;</span><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">Ibu Siti Meiningsih</span><span style=\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif;\">&nbsp;menjelaskan secara detail ciri-ciri hoaks, b</span>entuk hoaks, motif hoaks dan membagikan beberapa Tips dalam mengenal Isu Hoaks yang sedang marak di negeri ini. Hoaks dapat kita ketahui dalam bentuk seperti Gambar, Artikel, dan Audio Visual. Dan motif Hoaks bisa seperti :Lelucon/Iseng, Gagal Paham/Penafsiran Keliru, Persaingan Bisnis, Propaganda dan&nbsp;Alasan Pribadi/Sakit Hati.<br></p><p>Adapun ciri-ciri pesan hoaks adalah sebagai berikut :<br></p><p><span style=\"white-space:pre\">	</span>Pesannya sepihak, hanya membela atau menyerang saja.</p><p><span style=\"white-space:pre\">	</span>Sering mencatut nama nama tokoh seakan berasal dari tokoh itu.&nbsp;</p><p><span style=\"white-space:pre\">	</span>Memanfaatkan fanatisme dengan nilai-nilai idiologi atau agama untuk meyakinkan.</p><p><span style=\"white-space:pre\">	</span>Judul&nbsp; atau tampilan provokatif.</p><p><span style=\"white-space:pre\">	</span>Judul dengan isi atau link yang dibuka tidak cocok.</p><p><span style=\"white-space:pre\">	</span>Minta di-share atau diviralkan</p><p>Ada beberapa aspek kenapa hoaks sangat marak di Indonesia yaitu :<br></p><ul><li>a.<span style=\"white-space:pre\">	</span>Tingkat literasi yang rendah</li><li>b.<span style=\"white-space:pre\">	</span>Tingkat literasi Indonesia di urutan ke 60 dari 61 negara di bawah Botswana (Afrika) (Worlds Most Literate Nation Research, 2016)</li><li>c.<span style=\"white-space:pre\">	</span>Bangga jika dianggap paling update di medsos</li><li>d.<span style=\"white-space:pre\">	</span>Enggan mencari/mengklarifikasi kebernaran informasi</li><li>e.<span style=\"white-space:pre\">	</span>Fanatisme berlebihan</li></ul><p>Tanpa kita sadari Efek hoaks sangat mempengaruhi kehidupan dalam berbangsa dan bernegara, dimana dimulai dengan timbulnya yaitu&nbsp; :<br></p><p>a.<span style=\"white-space:pre\">	</span>Dampak Sosial :</p><ol><li>Perpecahan</li><li>Kekerasan</li><li>Memicu tindak kriminal</li><li>Kebingungan informasi</li><li>Pesimisme dan apatisme</li></ol><p>b.<span style=\"white-space: pre;\">	</span>Dampak kesehatan mental :<br></p><ol><li>Emosi berlebihan</li><li>Gundah</li><li>Paranoid</li></ol><p>Sebelum menjelaskan Hoaks lebih rinci, alangkah lebih baiknya kita mengetahui Tips Kenali Isu Hoaks seperti :<br></p><p>a.<span style=\"white-space:pre\">	</span>Diawal dengan kata-kata negatif atau heboh, contohnya ;&nbsp;</p><ol><li>Awas, virus xxx menyebar di Indonesia</li><li>Sebar kabar ini segera</li></ol><p>b.<span style=\"white-space:pre\">	</span>Mencatut nama orang/ilmiuwan ataupun lembaga terkenal, contohnya ;</p><p><span style=\"white-space:pre\">	</span> NASA mengatakan asterois raksasa akan menghantam bumi </p><p>c.<span style=\"white-space:pre\">	</span>Hanya muncul di pesan berantai</p><p>d.<span style=\"white-space:pre\">	</span>Kalimat ditulis dengan huruf kapital dan banyak tanda seru (!!!)</p><p>Oleh sebab itu dengan terselenggaranya diskusi ini, Pemerintah akan terus berupaya melakukan strategi-strategi peredaman Hoax yaitu dengan cara : Penegakan Hukum, Pemblokiran Situs/aplikasi, Melalui Institusi pendidikan, Membentuk komunitas-komunitas anti hoax, Forum-forum dialog dan diskusi, melalui media massa mainstream, Ujar Ibu Siti Meiningsih. Bapak Drs. HM. Syaiful Bahri Anshori ( Komisi I DPR RI Dapil Jatim IV ) juga menegaskan kepada masyarakat khususnya kabupaten Jember, apabila ditemukannya berita-berita bohong yang bisa meruntuhkan keutuhan persatuan dan kesatuan bangsa ini, segera sampaikan saja kepada kami supaya bisa segera kami tindak lanjuti.<br></p><p>Dalam menangkal berita-berita bohong dibutuhkan pemantapan nilai-nilai ideologi pancasila seperti;&nbsp; melalui literasi media digital yaitu kemampuan untuk menyaring, memilah, memilih, dan memproduksi pesan-pesan yang terdapat dalam media internet dan media sosial. Menyusun dan melaksanakan program literasi media digital bagi warga berwawasan pancasila. Dan meningkatkan kompetensi di bidang komunikasi, termasuk kemampuan untuk mengakses, menganalisis, dan mengevaluasi informasi dalam media digital yang dapat menguatkan nilai-nilai ideologi pancasila sebagai perekat bangsa<br></p><p>Dibutuhkan peran generasi muda pancasilais sebagai agen literasi media yaitu : Menjadi netizen yang aktif melakukan gerakan literasi untuk kepentingan bersama, Turut aktif membuat publik mengerti cara mengenali&nbsp; dan jahatnya hoax serta tidak ikut menyebarkannya, Mengajak aktif mengecek kebenaran informasi dan melakukan counter terhadap hoax jika memungkinkan, Mendorong gerakan&nbsp; turn back hoax dan Mendorong ikut memproduksi content positif...<br></p><p><br></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"6.jpg\" style=\"width: 1086px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"dialog2.jpg\" style=\"width: 1086px;\"><br></p>','8JYVTpCEABRUcIs2nn3oTvUjRkCVoQDEHD4EKEmB99ghIE4qwaylT2WHNcv2.jpeg','2019-03-06 05:54:18','2021-05-17 00:00:47',213,NULL,NULL),(11,1,'2019-05-06','Berita','KEMENTRIAN KOMUNIKASI DAN INFORMATIKA AKAN EVALUASI PELAKSANAAN SMART CITY','<p>Program Gerakan Menuju 100 Smart City yang digelar Kementrian Komunikasi dan Informatika RI telah memasuki tahun ketiga. Kabupaten Jember turut ambil bagian sejak tahun 2018 lalu. Output dari pelaksanaan Program Gerakan Menuju 100 Smart City tersebut adalah dokumen Masterplan Smart City Kabupaten Jember yang dipaparkan oleh Bupati Jember dr. Hj. Faida, MMR di hadapan panelis pada Desember lalu. Pada kesempatan tersebut, Bupati Jember memaparkan Quick Win Inovasi Unggulan Jember Safety Center Fokus Anak Ibu (JSC-FAI). Program tersebut bertujuan menurunkan angka kematian ibu dan bayi dengan menggunakan sistem monitoring kesehatan ibu hamil yang dipadukan dengan Sistem Emergency.</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"2.jpg\" style=\"width: 1086px;\"><br></p><p>Di tahun 2019 ini, akan dilaksanakan monitoring dan evaluasi terhadap implementasi Masterplan Smart City tersebut. Pemerintah Daerah akan dinilai komitmennya dalam menerapkan dan mengimplementasikan rencana strategis yang tertuang dalam dokumen Masterplan Smart City. Prinsip dari implementasi Smart City ini muaranya adalah kesejahteraan masyarakat. Untuk itu, salah satu indikator evaluasinya adalah bagaimana efek dari pelaksanaan Smart City di suatu daerah memberikan efek positif bagi kesejahteraan masyarakat<br></p><p>Plt Kepala Dinas Komunikasi dan Informatika Kabupaten Jember, Bapak Ratno Cahyadi Sembodo optimis terhadap kesiapan Kabupaten Jember dalam proses evaluasi dan monitoring Smart City ini. \"Kami fokus mengimplementasikan masterplan Smart City ini, untuk itu kami membutuhkan support dan kerjasama semua pihak baik rekan-rekan OPD, para akademisi perguruan tinggi di Jember dan pihak swasta untuk mewujudkan Jember sebagai Kota Cerdas\", ujarnya.</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"3.jpg\" style=\"width: 1086px;\"><br></p><p>Ke depan diharapkan 100 kabupaten/kota yang telah menjadi bagian dalam Program Gerakan Menuju 100 Smart City ini bisa menjadi role model dalam pengembangan Smart City di Indonesia.<br></p>','L8j70yrbxS5o6WH2ifJPlK3at3oSeoGTz9bf5K3HC485nn9YNGB9nhmF6Vh6.jpeg','2019-03-13 01:22:02','2021-05-15 11:01:43',549,NULL,NULL),(12,1,'2019-05-06','Berita','Kabel Semrawut Bakal Ditertibkan','<p><img src=\"data:image/jpeg;base64,\" data-filename=\"2.jpg\" style=\"width: 1086px;\"><br></p><p>Sumber : Radar Jember, Maret 2019</p>','aBDskoiXjLCtBpi0cCBnaMpMJhHTsz7CvWmExXlHSwhTA0onxgCsgcMMaNGh.jpeg','2019-03-13 03:40:41','2021-05-15 21:54:07',67,NULL,NULL);
INSERT INTO `feeds` VALUES (13,1,'2019-05-06','Berita','Pelatihan Pengenalan E-Commerce Bagi Kalangan Ibu Rumah Tangga','<p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\">Pelatihan yang digelar oleh Dinas Komunikasi Dan Informatika Jawa Timur bersama Perwakilan Google Jawa Timur serta Dinas Komunikasi Dan InformatikaKab. Jember di Balai Diklat di kompleks GOR Kaliwates, Selasa, 19 Maret 2019, diikuti sekitar 40 ibu rumah tangga.<br></p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\"><img src=\"data:image/jpeg;base64,\" data-filename=\"4.jpg\" style=\"width: 960px;\"><br></p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\"> Memberi pelatihan kepada laki-laki mendapat hasil satu laki-laki. Tapi, kalau melatih ibu-ibu, maka satu ibu-ibu sama dengan melatih satu generasi,  Bupati Jember dr. Hj. Faida, MMR., saat membuka pelatihan e-commerce bagi ibu rumah tangga.<br></p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\">E Commerce, menurut bupati, penting untuk memberdayakan ibu-ibu rumah tangga yang selama ini menjadi bagian penting ekonomi kerakyatan. Dengan teknologi informasi ini, mereka bakal mampu untuk berjualan secara berjaringan. Mereka diantaranya telah mengelola sebuah usaha. Namun diantaranya masih belum memiliki usaha.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\">Dengan IT, bagaimana mereka bisa merambah pasar yang tidak di depan mata dan tidak terjangkau kaki dan tangan. Serta meningkatkan omset dan meraih keuntungan lebih besar, ungkap bupati.</p><p class=\"MsoNormal\" style=\"margin-bottom:8.25pt;line-height:normal\"><span style=\"font-size:11.5pt;font-family:\" helvetica\",\"sans-serif\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";mso-bidi-font-family:arial;color:#676b6d\"=\"\">Secara sederhana\r\nE-commere dapat diartikan sebagai konsep penerapan E-bussines sebagai strategi\r\njual-beli barang dan jasa melalui jaringan elektronik dan biasanya melibatkan\r\ntransaksi data elektronik, sistem manajemen inventory otomatis dan sistem\r\npengumpulan data otomatis. Hal ini disebabkan semakin pesatnya perkembangan\r\nteknologi informasi baik dalam segi efisiensi serta keamanannya, sehinnga\r\nmemunculkan ide-ide gagasan untuk menjadikan teknologi informasi itu sebagai\r\nmedia untuk melakukan pemasaran, promosi, bahkan transakasi data yang dianggap\r\nbisa lebih effisien dan mempermudah transaksi jual-beli. apalagi dengan\r\nmeningkatnya perkembanganE-commerce</span></p><p class=\"MsoNormal\" style=\"margin-bottom:8.25pt;line-height:normal\"><span style=\"font-size:11.5pt;line-height:107%;\r\nfont-family:\" helvetica\",\"sans-serif\";mso-fareast-font-family:\"times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:arial;color:#676b6d;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us;mso-bidi-language:ar-sa\"=\"\">ada beberapa keunggulan e-commerce :<br>\r\n1. tidak mengenal adanya batasan tempat karena transaksi bisa terjadi walaupun\r\nkonsumen dan penjual berada di tempat yangberlainan<br>\r\n2. mengefisiensikan waktu karena tidak mengenal batasan atau setiap transaksi\r\ne-commerce bisa dilakukan selama 24 jam.<br>\r\n3. Lebih sedikitnya pegawai yang dibutuhkan untuk melakukan transaksi sehingga\r\ndapat mengikis anggaran pengeluaran perusahaan penjual.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:8.25pt;line-height:normal\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\"><o:p></o:p></span></p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\">Pelatihan ini dimulai dari 40 orang yang diundangan langsung oleh bupati. Kedepan akan diberi lebih banyak lagi peluang. Bukan hanya dilatih. Mereka yang mau berlatih, mau mengikuti perkembangan jaman, perlu didukung lebih.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\"><img src=\"data:image/jpeg;base64,\" data-filename=\"1.jpeg\" style=\"width: 1086px;\"><br></p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\">Karena itu, lanjut orang nomor satu di Jember ini, semua peserta pelatihan berhak menerima bantuan permodalan tanpa jaminan.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\"> Jaminannya adalah semangat yang mereka punyai, dan UMKM yang mereka punyai, produk yang mereka punyai. Pelatihn hari ini cukup menjadi jaminan bahwa mereka mendapat dukungan modal usaha dari 2,5 juta sampai 25 juta,  ungkapnya.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\">Kepala Badan Pengembangan Sumber Daya Manusia dan Penelitian Komunikasi dan Informatika (BPSDMP Kominfo) Surabaya di Sidoarjo, Eka handayani, menyampaikan, BPSDMP Surabaya Kementerian Komunikasi dan Informatika pelatihan ini juga untuk mendorong segera terwujudnya Jember Smart City.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\">Salah satu unsur untuk meningkatkan perekonomian di Jember, dengan upaya bagaimana ibu-ibu tidak ketinggalan jaman juga gaul. Khususnya untuk e-commerce, sehingga Kabupaten Jember segera terwujud smart citynya dengan e-commerce, katanya.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\"><img src=\"data:image/jpeg;base64,\" data-filename=\"3.jpg\" style=\"width: 960px;\"><br></p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\">Bersama narasumber Intan Kusuma Dewi dari Google Jawa Timur memberikan fasilitasi dan tips bagaimana strategi menaikkan omset, strategi pemasaran dan<span style=\"color: rgb(67, 67, 67); font-family: Roboto, serif; font-size: 12pt;\">cara berinteraksi dengan pelanggan\r\nyang baik dan benar</span></p><h1 style=\"margin:0in;margin-bottom:.0001pt\"><o:p></o:p></h1><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\">Dengan pelatihan ini, diharapkan bagi yang belum memiliki produk atau yang sudah mempunyai dapat menjual perdagangannya secara online atau sebagai resseler.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 13px;=\"\" text-align:=\"\" justify;\"=\"\">Ini ibu ibu rumah tangga hebat. Tidak hanya merawat suami dan mendidik anak, tetapi juga sebagai penopang ekonomi keluarga, ujarnya</p>','taJ89B10UPxEEkCBjetU0WNptvyUVwVU1kqrsJpKAaxn7dZnSFD2Osm2xXz2.jpeg','2019-03-20 08:59:30','2021-05-13 03:47:38',429,NULL,NULL),(14,1,'2019-05-06','Berita','Menumbuhkan Kesadaran Literasi Media untuk Menangkal Hoaks','<p>Diselenggarakan pada hari Minggu tanggal. 24 Maret 2019 di Hotel Dafam Lt. 8 dan dibuka langsung oleh Direktorat IKP Kemkominfo RI Ibu Siti Meiningsih, Dan juga dihadiri oleh Anggota DPR RI Bapak Syaiful Bahri Ansori, MP. Jumlah peserta yg dihadiri 100 orang lebih itu penuh dengan tanya jawab sehingga acara tersebut sangat membantu masyarakat untuk lebih memahami berita hoaks. </p><p>Ditahun ini pelaksanaan kegiatan Diskusi Publik diselenggarakan di Kabupaten Jember untuk yang kedua kalinya, diharapkan dapat meningkatkan lagi kemampuan masyarakat dalam memilih, memilah, memahami, menganalisis dan mendekonstruksi pesan dan informasi sehingga publik menjadi sadar (melek) tentang cara sebuah pesan atau informasi dibuat dan diakses agar publik memahami berbagai ruang lingkup lain dibalik semua informasi. Sehingga masyarakat bisa saring terlebih dahulu informasi apapun sebelum di sharing.</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"2.jpg\" style=\"width: 1040px;\"><br></p>','Q3UUU5r7ojpaakTH4WZrffgcf7HjiwIXBmhadPgeTPFOHazSLZvE4pSAPUeg.jpeg','2019-03-25 03:08:56','2021-05-13 17:11:55',62,NULL,NULL);
INSERT INTO `feeds` VALUES (15,1,'2019-05-08','Berita','Pemkab Jember Mulai Terapkan Aplikasi E-Absensi Dan E-surat','<p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span style=\"font-size:10.5pt;\r\nfont-family:\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e\"=\"\">Sudah\r\nsaatnya penyelenggaraan Pemerintahan di Kabupaten Jember mulai berbasis IT agar\r\nmemudahkan pengelolaan administrasi khususnya pengelolaan Sistem Kepegawaian\r\nASN di Lingkungan Pemerintah Kabupaten Jember. Tahun ini&nbsp;Pemerintah\r\nKabupaten Jember&nbsp;mulai </span><span lang=\"IN\" style=\"font-size:10.5pt;\r\nfont-family:\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e;=\"\" mso-ansi-language:in\"=\"\">mewujudkan </span><span style=\"font-size:10.5pt;\r\nfont-family:\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e\"=\"\">hal\r\ntersebut dengan diselenggarakannya&nbsp;Sosialisasi dan Bimbingan Teknis e</span><span lang=\"IN\" style=\"font-size:10.5pt;font-family:\" montserrat\",\"serif\";mso-bidi-font-family:=\"\" arial;color:#2e2e2e;mso-ansi-language:in\"=\"\">-</span><span style=\"font-size:10.5pt;\r\nfont-family:\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e\"=\"\">Absensi\r\ndan e-Surat di Hotel Royal Jember </span><span lang=\"IN\" style=\"font-size:10.5pt;\r\nfont-family:\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e;=\"\" mso-ansi-language:in\"=\"\">selama 4 Hari (</span><span style=\"font-size:10.5pt;\r\nfont-family:\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e\"=\"\"> 29\r\nApril s/d 3 Mei 2019</span><span lang=\"IN\" style=\"font-size:10.5pt;font-family:\r\n\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e;mso-ansi-language:=\"\" in\"=\"\"> ) yang diikuti oleh Operator OPD dan Pejabat Eselon IV,III serta II.</span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><img src=\"data:image/jpeg;base64,\" data-filename=\"1.jpg\" style=\"width: 1086px;\"><span lang=\"IN\" style=\"font-size:10.5pt;font-family:\r\n\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e;mso-ansi-language:=\"\" in\"=\"\"><br></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span lang=\"IN\" style=\"font-size:10.5pt;font-family:\r\n\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e;mso-ansi-language:=\"\" in\"=\"\"></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span style=\"font-size:10.5pt;\r\nfont-family:\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e\"=\"\">Dengan\r\ndiselenggarakannya&nbsp;Sosialisasi dan Bimbingan Teknis e</span><span lang=\"IN\" style=\"font-size:10.5pt;font-family:\" montserrat\",\"serif\";mso-bidi-font-family:=\"\" arial;color:#2e2e2e;mso-ansi-language:in\"=\"\">-</span><span style=\"font-size:10.5pt;\r\nfont-family:\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e\"=\"\">Absensi\r\ndan e-Surat </span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";=\"\" color:#555555;mso-ansi-language:in\"=\"\">Diharapkan untuk segera</span><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">\r\nditerapkan di seluruh Dinas, </span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555;mso-ansi-language:in\"=\"\">K</span><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">ecamatan\r\nsampai </span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";=\"\" color:#555555;mso-ansi-language:in\"=\"\">K</span><span style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">elurahan. &nbsp;</span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555;mso-ansi-language:in\"=\"\">Pada Hari </span><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">Jumat </span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555;=\"\" mso-ansi-language:in\"=\"\">tanggal </span><span style=\"font-size:10.0pt;font-family:\r\n\" arial\",\"sans-serif\";color:#555555\"=\"\">03 Mei 2019 di Hotel Royal Jember,\r\nSekretaris Daerah Kabupaten Jember Ir. Mirfano </span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555;=\"\" mso-ansi-language:in\"=\"\">berkesempatan menutup acara </span><span style=\"font-size:10.5pt;font-family:\" montserrat\",\"serif\";mso-bidi-font-family:=\"\" arial;color:#2e2e2e\"=\"\">Sosialisasi dan Bimbingan Teknis e</span><span lang=\"IN\" style=\"font-size:10.5pt;font-family:\" montserrat\",\"serif\";mso-bidi-font-family:=\"\" arial;color:#2e2e2e;mso-ansi-language:in\"=\"\">-</span><span style=\"font-size:10.5pt;\r\nfont-family:\" montserrat\",\"serif\";mso-bidi-font-family:arial;color:#2e2e2e\"=\"\">Absensi\r\ndan e-Surat</span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";=\"\" color:#555555;mso-ansi-language:in\"=\"\"> sekaligus juga meresmikannya. Beliau </span><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">m</span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555;=\"\" mso-ansi-language:in\"=\"\">enuturkan bahwa,</span><span lang=\"IN\" style=\"font-size:\r\n10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555\"=\"\"> </span><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555\"=\"\"></span><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555;=\"\" mso-ansi-language:in\"=\"\"> </span><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";=\"\" color:#555555\"=\"\">Aplikasi ini bisa membantu cara kerja pengelolaan administrasi\r\nbisa lebih efisien</span><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";=\"\" color:#555555;mso-ansi-language:in\"=\"\"> </span><span style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555\"=\"\"></span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555;=\"\" mso-ansi-language:in\"=\"\">.</span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555;=\"\" mso-ansi-language:in\"=\"\"><o:p><span lang=\"IN\" style=\"font-size: 10pt; line-height: 107%;\">Dalam acara tersebut\r\ndijelaskan </span><span style=\"font-size: 10pt; line-height: 107%;\">Aplikasi ini dapat memudahkan mengontrol surat-</span><span lang=\"IN\" style=\"font-size: 10pt; line-height: 107%;\">menyu</span><span style=\"font-size: 10pt; line-height: 107%;\">rat,\r\nmemilah surat yang sudah maupun belum ditindaklanjuti.</span><span style=\"font-size: 10pt; line-height: 107%;\"> </span><span style=\"font-size: 10pt; line-height: 107%;\">Sekretaris Daerah mengatakan bahwa penerapan aplikasi ini merupakan langkah awal yang baik. Namu</span><span lang=\"IN\" style=\"font-size: 10pt; line-height: 107%;\">n</span><span style=\"font-size: 10pt; line-height: 107%;\">,\r\nmasih banyak lagi tugas Dinas </span><span lang=\"IN\" style=\"font-size: 10pt; line-height: 107%;\">Komunikasi dan Informatika</span><span style=\"font-size: 10pt; line-height: 107%;\">\r\nKabupaten Jember dalam mengembangkan teknologi informasi untuk menjadikan\r\nJember sebuah daerah yang maju</span></o:p></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">OPD juga telah berkomiten untuk\r\nmenerapkan aplikasi ini.</span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555;mso-ansi-language:in\"=\"\"> Tantangan\r\nkita saat ini adalah tidak tertutup kemungkinan banyak OPD yang</span><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555\"=\"\"> masih\r\nbelum&nbsp;<em>friendly</em></span><em><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555;=\"\" mso-ansi-language:in\"=\"\"> </span></em><span lang=\"IN\" style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555;mso-ansi-language:in\"=\"\">dengan perubahan\r\nyang sedemikian cepat.&nbsp; <o:p></o:p></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">Muda Wiguna, selaku konsultan pembuatan\r\naplikasi Absensi dan&nbsp;E-Surat yang menjadi rekanan Dinas </span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555;=\"\" mso-ansi-language:in\"=\"\">Komunikasi dan Informatika</span><span style=\"font-size:\r\n10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555\"=\"\"> Kabupaten Jember </span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555;=\"\" mso-ansi-language:in\"=\"\">menuturkan, </span><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(85, 85, 85); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(85, 85, 85); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> </span><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(85, 85, 85); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Meski di awal\r\nmasih belum&nbsp;<em><span style=\"font-family:\" arial\",\"sans-serif\"\"=\"\">friendly</span></em>.\r\nMudah-mudahan cepat dicerna,</span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">Aplikasi E-Surat digunakan di\r\nmasing-masing OPD</span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";=\"\" color:#555555;mso-ansi-language:in\"=\"\"> mulai dari </span><span style=\"font-size:\r\n10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">Kepala OPD, Eselon\r\nII,III, dan IV. Juga digunakan oleh staf untuk operator surat masuk dan surat\r\nkeluar dalam bentuk </span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\r\n\" arial\",\"sans-serif\";color:#555555;mso-ansi-language:in\"=\"\">Website</span><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555\"=\"\"> dan </span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555;=\"\" mso-ansi-language:in\"=\"\">aplikasi berbasis </span><span style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">android.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span lang=\"IN\" style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555;mso-ansi-language:in\"=\"\">Dan juga </span><span style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">Aplikasi\r\nabsensi </span><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";=\"\" color:#555555;mso-ansi-language:in\"=\"\">ini </span><span style=\"font-size:10.0pt;\r\nfont-family:\" arial\",\"sans-serif\";color:#555555\"=\"\">bertujuan untuk mendukung\r\nprogram kegiatan bupati yakni mendisiplinkan seluruh Pegawai Pemerintah\r\nKabupaten Jember.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span style=\"font-size: 10pt;\">Jadi seluruh pegawai ASN\r\nKabupaten Jember harus menerapkan aplikasi absensi. Sehingga mulai dari jam\r\nmasuk, keluar, terlambat, ijin, sakit bisa termonitor di ruangan bupati,\r\nterangnya.</span><br></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(85, 85, 85); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10pt;\">Rencana aplikasi berlaku per\r\ntanggal 6 Mei. Jadi bagi ASN yang belum mendaftarkan sidik jarinya bisa\r\nmelalui kominfo untuk pelayanan&nbsp; pendaftaran sidik jari.</span>&nbsp;</span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(85, 85, 85); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p><br></o:p></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><img src=\"data:image/jpeg;base64,\" data-filename=\"2.jpeg\" style=\"width: 1086px;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(85, 85, 85); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p><br></o:p></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in;\r\ntext-align:justify;line-height:16.5pt\"><span lang=\"IN\" style=\"font-size:10.0pt;font-family:\" arial\",\"sans-serif\";color:#555555;=\"\" mso-ansi-language:in\"=\"\"><o:p><span style=\"font-size: 10pt; line-height: 107%;\">\r\n\r\n</span></o:p></span><img src=\"data:image/jpeg;base64,\" data-filename=\"2.jpg\" style=\"width: 1086px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"3.jpg\" style=\"width: 1086px;\"></p>','NUbLe0thc0Au8PPC0YnsxpGZB2oNasin4U7l4o7UmzMJqqTgOQYynaPAdaqJ.jpeg','2019-05-08 04:13:07','2021-05-16 04:27:04',500,NULL,NULL),(16,1,'2019-05-10','Berita','Jember Menjadi Lokasi Akademi Digital Talent Scholarship 2019','<p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Guna meningkatkan sumber daya manusia di bidang teknologi informasi dan komunikasi (TIK), Bupati Jember dr. Hj. Faida, MMR., mendorong warga Jember untuk memanfaatkan beasiswa dari Kementerian Komunikasi dan Informatika.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Upaya tersebut dilakukan bupati setelah menerima paparan dari Kepala UPT Badan Penelitian dan Pengembangan SDM (BPSDMP) Kementerian Kominfo Surabaya Eka Handayani, Kamis 09 Mei 2019, di Pendapa Wahyawibawagraha.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Salah satu upaya bupati yakni dengan memasang iklan sosialisasi di media massa untuk program beasiswa Digital Talent Scholarship (DTS). Supaya bupati bisa membantu anak Jember, kata bupati.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"Digital-Talent-Scholarship-9.jpeg\" style=\"width: 1086px;\"><br></p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Bagi pegawai negeri sipil di lingkungan Pemkab Jember, bupati juga mewajibkan untuk mengikuti program Online Academy (OA). Akan dipilih seratus lebih pegawai untuk mengikutinya.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Diwajibkan mengikuti OA untuk mengetahui informasi yang lebih luas dalam pelatihan ini, juga untuk kombinasi program lokal kedepannya, ungkap bupati.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Gugu-guru yang mengajar bidang TIK juga menjadi perhatian bupati untuk aktif dalam program ini. Mereka akan diundang dalam acara buka puasa bersama guna mendapatkan sosialisasi program Kementerian Kominfo ini.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Utamanya untuk para pelamar kerja, juga akan disosialisasikan program DTS, bupati.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Kepala UPT BPSDMP Kementerian Kominfo Surabaya, Eka Handayani, menjelaskan, DTS merupakan beasiswa pelatihan intensif bagi 25 ribu peserta di seluruh Indonesia.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Program ini bertujuan untuk meningkatkan keterampilan dan daya saing SDM di bidang TIK dalam menyongsong Revolusi Industri 4.0, dengan goals sertifikasi internasional yang akan dikeluarkan oleh badan Litbang SDM.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"Digital-Talent-Scholarship-11.jpeg\" style=\"width: 1086px;\"><br></p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Program DTS ini memiliki empat program. Pertama program Fresh Graduate Academy (FGA) yang khusus untuk D3, D4, dan S1 di Jatim bertempat di ITS, UB dan Universitas Surabaya selama 2 bulan.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Program kedua yakni Vocational School Graduate Academy (VSGA) untuk alumni SMK TIK. Program ini dilaksanakan selama satu bulan di Politeknik Jember.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Kemudian program Online Academy (OA) untuk PNS, non PNS, masyarakat umum dan lainnya. Terakhir yakni program Coding Teacher Academy (CTA) khusus untuk guru-guru SMK/SMA yang mengajar TIK.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Selain goals sertifikasi international yang didapatkan,&nbsp; peserta VSGA, CTA, dan OA bagi yang belum bekerja akan dimasukkan ke data base Kementerian Kominfo.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Mereka yang masih mencari kerja ini akan dipertemukan dengan pihak industry. Ada 113 Industri yang akan memanfaatkan alumni DTS yang bersertifikasi.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Eka Handayani menambahkan, peluang kedepan ada 2,1 juta jenis pekerjaan baru yang tidak bisa dideteksi berkaitan dengan TIK, sehingga harus meningkatkan keterampilan dengan mengikuti DTS.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Bupati Jember sangat mendukung kegiatan ini dengan luar biasa. Diharapkan Jember bisa mempunyai banyak SDM yang sudah tersertifikasi, harapnya.</p><p style=\"margin-bottom: 10px; line-height: 22px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; text-align: justify;\">Pendaftaran untuk ikut program ini sampai 19 Mei 2019. Tidak dipungut biaya atau gratis. Persyaratan bisa dilihat pada laman web digitaltalent.kominfo.go.id</p>','cxgSszns2cn2Kz6t9JAoYE6l0SvQIS4lzf7n10kOdv53lzJVOPduNSgOWBoS.jpeg','2019-05-10 07:53:14','2021-05-13 17:03:04',279,NULL,NULL),(17,1,'2019-07-01','Berita','KITA INDONESIA KITA PANCASILA','<h3 style=\"margin: 0px 0px 0.6em; padding: 0px; position: relative; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: bold