y (OA) Digital Talent Scholarship 2019','<p style=\"margin-bottom: 20px; font-size: 16px; line-height: 27px; padding: 0px; color: gray; font-family: nunito, helveticaneue, &quot;helvetica neue&quot;, Helvetica, Arial, sans-serif;\"><span style=\"font-weight: 600;\"><font face=\"Helvetica\">Selamat kepada semua peserta OA yang sudah lulus!</font></span></p><p style=\"margin-bottom: 20px; font-size: 16px; line-height: 27px; padding: 0px; color: gray; font-family: nunito, helveticaneue, &quot;helvetica neue&quot;, Helvetica, Arial, sans-serif;\"><font face=\"Helvetica\">Terlampir list nama-nama para peserta yang sudah lolos seleksi dapat diunduh pada link berikut :</font></p><p style=\"margin-bottom: 20px; font-size: 16px; line-height: 27px; padding: 0px; color: gray; font-family: nunito, helveticaneue, &quot;helvetica neue&quot;, Helvetica, Arial, sans-serif;\"><font face=\"Helvetica\">Online Academy (OA) dalam link berikut ini :&nbsp;<a href=\"https://s.id/PesertaDTS-OA\" style=\"color: rgb(42, 65, 232); transition: all 0.3s ease 0s; outline: 0px !important;\" target=\"_blank\">https://s.id/PesertaDTS-OA</a></font></p><p style=\"margin-bottom: 20px; font-size: 16px; line-height: 27px; padding: 0px; color: gray; font-family: nunito, helveticaneue, &quot;helvetica neue&quot;, Helvetica, Arial, sans-serif;\"><font face=\"Helvetica\">1. Pengumuman peserta lolos dikirimkan melalui email masing-masing yang sudah didaftarkan pada saat registrasi<br></font></p><p style=\"margin-bottom: 20px; font-size: 16px; line-height: 27px; padding: 0px; color: gray; font-family: nunito, helveticaneue, &quot;helvetica neue&quot;, Helvetica, Arial, sans-serif;\"><font face=\"Helvetica\">2. Jika tidak ditemukan di kotak masuk, silakan cek folder spam anda.</font></p><p style=\"margin-bottom: 20px; font-size: 16px; line-height: 27px; padding: 0px; color: gray; font-family: nunito, helveticaneue, &quot;helvetica neue&quot;, Helvetica, Arial, sans-serif;\"><font face=\"Helvetica\">3. Ketika anda sudah menerima email pemberitahuan mohon perhatikan jadwal pelaksanaan pelatihan</font></p><p style=\"margin-bottom: 20px; font-size: 16px; line-height: 27px; padding: 0px; color: gray; font-family: nunito, helveticaneue, &quot;helvetica neue&quot;, Helvetica, Arial, sans-serif;\"><font face=\"Helvetica\">4.&nbsp;<span style=\"background-color: transparent; font-size: 10pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Cek informasi terkait jadwal dan silabus </span><span style=\"font-size: 10pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">pelatihan</span><span style=\"background-color: transparent; font-size: 10pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> pada </span><span style=\"background-color: transparent; font-size: 10pt; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Pedoman Peserta Online Academy</span><span style=\"background-color: transparent; font-size: 10pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> di link</span><a href=\"https://k-cloud.kominfo.go.id/s/BerkasDTSOA\" style=\"color: rgb(42, 65, 232); background-color: rgb(255, 255, 255); transition: all 0.3s ease 0s; outline: 0px !important;\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> </span></a><a href=\"https://k-cloud.kominfo.go.id/s/BerkasOADTS\" style=\"color: rgb(42, 65, 232); background-color: rgb(255, 255, 255); transition: all 0.3s ease 0s; outline: 0px !important;\" target=\"_blank\"><span style=\"font-size: 10pt; color: rgb(17, 85, 204); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">https://k-cloud.kominfo.go.id/s/BerkasOADTS</span></a><span style=\"background-color: transparent; font-size: 10pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">.</span></font></p>','KbXvm2zmtfVvW4ruMBQ69kttqMfmMSySMaE5DhFgXAPTW04aRHtTB92DRile.jpeg','2019-08-02 00:24:21','2021-05-14 17:48:19',206,NULL,NULL),(70,13,'2021-05-08','Berita','Bupati Anjurkan untuk Terapkan Terima Kasih','<p>Diskominfo Jember  Perekonomian bisa tumbuh dengan konsep terima kasih. Karena itu, para pengusaha didorong untuk menerapkannya di tengah-tengah perekonomian masyarakat yang sedang lesu akibat Covid-19.&nbsp;<br></p><p>Bahasa terima kasih itu harus diimplementasikan kepada semua kehidupan, kepada semua orang, ujar Bupati Jember Hendy Siswanto saat pelepasan bantuan sembako oleh MUI Jember, Sabtu, 8 Mei 2021.&nbsp;<br></p><p>Terima, kasih. Kalau terima saja, tidak bisa. Berhenti. Ilmu profesor pun mati kalau tidak menghayati arti terima kasih. Mau dibuat apa ilmunya, mau dipakai apa. Ilmu itu harus diamalkan, kata bupati di Toko Rindang Khatulistiwa di Jalan Kalimantan, Sumbersari, tempat pelepasan pengiriman sembako.<br></p><p>Di perdagangan, lanjut bupati, kalau hasilnya disimpan saja, maka perekonomian tidak bisa bergerak. Dampaknya, tidak ada pembeli.&nbsp;<br></p><p>Bagi pengusaha, menurut Bupati Hendy, konsep terima kasih itu berarti wajib memberikan bantuan. Tidak harus diminta lebih dulu agar membantu. Kalau dapat untung, kasihkan lagi. Supaya lebih untung, tuturnya.&nbsp;<br></p><p>Terkait dengan pembagian sembako oleh MUI Jember, Bupati Hendy menyatakan dukungannya. Bahkan mendorong pembagian sembako itu tidak hanya pada momen bulan Ramadhan.&nbsp;<br></p><p>Penyaluran bantuan sembako itu dilakukan tiga bulan sekali. Terkait besar kecil bantu, bupati menyarankan tidak menjadi ukuran. Yang penting rutin, tandasnya. Sebab, sembako dibutuhkan tiap hari untuk makan, imbuhnya.&nbsp;<br></p><p>Sementara itu, Ketua MUI Jember Abdul Haris menjelaskan, paket sembako yang disalurkan sebanyak 200 paket, yang disalurkan menggunakan dua mobil di dua lokasi berbeda.&nbsp;<br></p><p>Kami belum rapat kerja, tapi karena dampak Covid-19 yang luar biasa, pengurus di Komisi Pemberdayaan Umat yang menjadi pengusaha peduli. Insya Allah ke depan akan lebih diintensifkan, terangnya.<br></p><p>Dalam kesempatan tersebut, Bupati Hendy didampingi Wakil Bupati Jember Muhammad Firjaun Barlaman dan pengurus MUI Jember melepas dua mobil boks pengangkut paket sembako. (aif)<br></p>','qcMKHHqs7TUCmkuKki5mv7zbcITm0FyC9bYq1xTGzlFNPKkjTuuCfD9h8Huf.jpeg','2021-05-08 04:53:07','2021-05-12 21:34:53',72,NULL,NULL),(72,13,'2021-05-09','Berita','Bupati Hendy Lantik 59 Penjabat Kepala Desa','<p class=\"MsoNormal\"><b>Diskominfo Jember</b><span lang=\"EN-US\">  Bertempat di Aula PB Soedirman, Sabtu, 8 Mei 2020, Bupati Jember\r\nHendy Siswanto melantik 10 penjabat kepala desa.&nbsp;</span><br></p><p class=\"MsoNormal\">Dalam sambutannya, Bupati Hendy mengatakan\r\nkemajuan Kabupaten Jember sangat tergantung dari desa. Kepala desa pun merupakan\r\nujung tombak dari penyelenggara pemerintahan desa.<br></p><p class=\"MsoNormal\">Oleh karena itu, dibutuhkan kolaborasi dan\r\nkomunikasi antara pemerintah desa dengan Pemkab Jember<br></p><p class=\"MsoNormal\">Tidak mungkin seorang bupati bisa\r\nmemajukan wilayah Jember tanpa bantuan dari kepala desa,\" terang bupati\r\npilihan rakyat ini.<br></p><p class=\"MsoNormal\">Ujung tombak kesuksesan seluruh Kabupaten Jember\r\ntergantung dari bagaimana menyelesaikan masalah di masyarakat secara kongkrit,\r\nujar Bupati Hendy.<br></p><p class=\"MsoNormal\">Bupati menerangkan sebenarnya terdapat 59 penjabat\r\nkepala desa yang dilantik. Namun, karena situasi pandemi Covid-19, maka hanya pelantikan\r\ndiwakili oleh sepuluh orang.<br></p><p class=\"MsoNormal\">Pelantikan hari ini dari total 59 kepala\r\ndesa yang dilantik hanya ada 10 perwakilan kepala desa. Sedangkan SK penjabat\r\nkepala desa lainnya langsung diserahkan ke tempat masing-masing, terang Bupati\r\nHendy didampingi Wakil Bupati MB Firjaun Barlaman kepada wartawan usai\r\npelantikan.<br></p><p class=\"MsoNormal\">Ke-59 orang tersebut menggantikan kepala\r\ndesa yang telah habis masa jabatannya, maupun yang telah meninggal dunia. Kepala\r\ndesa definitif akan dipilih dalam pilkades serentak tahun ini.<br></p><p class=\"MsoNormal\">Selain itu, kepada wartawan Bupati Hendy menyampaikan\r\nkabar bahagia terkait CPNS 2021.<br></p><p class=\"MsoNormal\">Insya Allah pada bulan Juni ini, Jember\r\nakan mendapatkan jatah CPNS sejumlah 4305 CPNS. Adapun formasi CPNS berjumlah\r\n634 formasi dan formasi PPPK berjumlah 3671 formasi, terangnya.<br></p><p class=\"MsoNormal\">Bupati berharap seluruh masyarakat Jember\r\nsegera melengkapi berkas dan mempersiapkan diri secara maksimal untuk CPNS\r\n2021. (<b>am/aif</b>)<br></p>','vJKSDRmxyBrEntftxUZVDEhWOn1918QO9nasaKf7rXEuNvNnHd0pOKMCVeci.jpeg','2021-05-09 00:50:55','2021-05-14 10:56:12',47,NULL,NULL);
INSERT INTO `feeds` VALUES (73,13,'2021-05-09','Berita','Dukung Festival Al Quran untuk Jember Religius','<p class=\"MsoNormal\"><b>Diskominfo Jember</b><span lang=\"EN-US\">  Salah satu program kerja Pemerintah Kabupaten Jember adalah Jember\r\nreligius. Karena itu, Pemkab Jember mendukung setiap kegiatan untuk mewujudkan\r\nprogram itu.</span><br></p><p class=\"MsoNormal\">Termasuk Festival Al-Quran yang\r\ndiselenggarakan oleh Radio Prosalina Jember selama bulan Ramadhan 2021.</p><p class=\"MsoNormal\">Mudah-mudahan dari festival ini lahir\r\npencinta Al-Quran yang handal. Sehingga dapat membawa energi positif kepada\r\nseluruh wilayah Jember, ujar Wakil Bupati Jember Muhammad Balya Firjaun\r\nBarlaman.</p><p class=\"MsoNormal\">Malam Grand Final Festival Al-Quran itu\r\ndigelar di Masjid Roudhotul Muchlisin, Sabtu malam, 8 Mei 2021.</p><p class=\"MsoNormal\">Festival Al-Quran setiap bulan Ramadhan tahun\r\nini oleh Prosalina telah memasuki tahun ke-15. Festival tersebut diikuti oleh\r\npara penghafal Al-Quran (<i>huffadz</i>) dari usia anak-anak hingga remaja.</p><p class=\"MsoNormal\">Harapannya, kegiatan semacam ini tidak\r\nhanya dilaksanakan pada saat bulan Ramadhan saja. Namun juga bulan-bulan yang\r\nlain untuk menjaring calon-calon hafidz-hafidzah baru. Karena ini bagian dari\r\nperhatian Pemkab Jember menjadikan Jember sebagai kota religius, tambahnya.</p><p class=\"MsoNormal\">Babak penentuan itu diikuti oleh 22 peserta\r\nyang terbagi di 3 kategori. 10 peserta di kategori 10 juz, 6 peserta di\r\nkategori 20 juz, dan 6 orang di kategori 30 juz.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2021-05-09 at 07.13.24 (1).jpeg\" style=\"width: 50%;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2021-05-09 at 07.13.24 (2).jpeg\" style=\"width: 50%;\"><br></p><p class=\"MsoNormal\">Pelaksana Tugas Kepala Dinas Komunikasi dan\r\nInformatika Habib Salim yang hadir hingga selesai kegiatan pukul 21.00  24.00\r\nWIB juga mengungkapkan dukungannya.<br></p><p class=\"MsoNormal\">Kami sangat mendukung acara ini karena\r\nmerupakan kegiatan yang menumbuhkan semangat keberagamaan terutama di bulan\r\nRamadhan, ungkapnya.<br></p><p class=\"MsoNormal\">Habib Salim menyampaikan bahwa dari 15 kali\r\nfestival digelar, ini baru pertama kalinya Pemkab Jember hadir menjadi sponsor.<br></p><p class=\"MsoNormal\">Hal tersebut menjadi konsentrasi untuk\r\nterus membangun Kabupaten Jember terutama dalam ranah keagamaan. Yakni\r\nmenjadikan Jember sebagai Kota Religius, tegasnya.&nbsp;<span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">(</span><b style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">mar/aif</b><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">)</span><br></p>','S2mdO3TY4WLXAEhzCJUYDFCl5iDyztPA68ySWJqIeReqGBhvZtMpupoDHNyh.jpeg','2021-05-09 00:55:12','2021-05-16 22:26:02',31,NULL,NULL),(74,13,'2021-05-09','Berita','Forkopimda dan Ulama Jember Tindak Lanjuti SE Menteri Agama','<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.25pt;margin-left:\r\n0cm\"><b><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">Diskominfo Jember</span></b><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">  Forum Komunikasi Pimpinan Daerah\r\n(Forkopimda) bersama ulama Jember mengimbau masyarakat untuk melaksanakan\r\nsholat Idul Fitri berjamaah di rumah masing-masing.&nbsp;<o:p></o:p></span></p><p style=\"margin: 0cm 0cm 8.25pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">Hal\r\nitu sebagai tindak lanjut Surat Edaran Menteri Agama RI Nomor 07 Tahun 2021\r\ntentang Panduan Penyelenggaraan Salat Idul Fitri Tahun 1442 Hijriyah / 2021\r\nMasehi di tengah pandemi Covid-19.<o:p></o:p></span></p><p style=\"margin: 0cm 0cm 8.25pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">Mengacu\r\nSE Menteri Agama maka sholat Idul Fitri berjamaah dilarang dilakukan di kawasan\r\nzona merah dan oranye. Namun, bisa dilakukan di rumah masing-masing, terangnya\r\nusai rakor bersama Forkopimda dan ulama terkait SE itu.<o:p></o:p></span></p><p style=\"margin: 0cm 0cm 8.25pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">Sementara\r\nuntuk zona hijau dan kuning boleh mengadakan Sholat Idul Fitri berjamaah di\r\nmasjid dengan tetap menerapkan ketentuan protokol Kesehatan.<o:p></o:p></span></p><p style=\"margin: 0cm 0cm 8.25pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">Saat\r\nini Jember masuk dalam zona oranye. Bupati pun menegaskan agar masyarakat\r\nJember betul-betul mematuhi surat edaran yang bertujuan untuk mengantisipasi\r\npenyebaran Covid-19.<o:p></o:p></span></p><p style=\"margin: 0cm 0cm 8.25pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">\"Ini\r\nserius bahwa Covid-19 itu nyata. Buktinya, adik kandung saya sendiri meninggal\r\nkarena Covid-19,\" katanya Bupati Hendy.<o:p></o:p></span></p><p style=\"margin: 0cm 0cm 8.25pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">Selain\r\nitu, SE tersebut mengatur kegiatan takbiran. Kegiatan ini boleh dilakukan di\r\nmasjid dan mushollah dengan peserta 10 persen dari kapasitas, memerhatikan\r\nstandar protokol kesehatan Covid-19 secara ketat, seperti menggunakan masker,\r\nmenjaga jarak, dan menghindari kerumunan<o:p></o:p></span></p><p style=\"margin: 0cm 0cm 8.25pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">Takbiran\r\nitu juga diimbau untuk disiarkan secara virtual sesuai ketersediaan perangkat\r\ntelekomunikasi di masjid dan mushollah. Sedang takbiran keliling dilarang untuk\r\nmenghindari kerumunan.<o:p></o:p></span></p><p style=\"margin: 0cm 0cm 8.25pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">Terkait\r\nkegiatan halal bi halal atau silaturahmi selama lebaran, bupati menyarankan\r\nuntuk dilakukan secara daring. Bupati juga tegas melarang ASN menggelar open\r\nhouse selama lebaran.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p style=\"margin: 0cm 0cm 8.25pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">\"ASN\r\nharus menjadi contoh yang baik bagi masyarakat umum, jika melanggar tentu ada\r\nsanksi,\" pungkas Hendy.&nbsp; (<b>sa/aif</b>)<o:p></o:p></span></p>','T6frOrF5HTScFHpEYDq0EDakiIvnqQbWeOG7Y3yYBSo74dS5l3Iwbp1m0BPm.jpeg','2021-05-09 09:25:14','2021-05-15 22:55:34',18,NULL,NULL),(75,13,'2021-05-09','Berita','Koordinasi Stakeholder Tembakau Menghadapi Musim Tanam Tahun 2021','<p class=\"MsoNormal\"><b>Diskominfo Jember</b><span lang=\"EN-US\"> - Bupati Jember Hendy Siswanto mengundang pengusaha dan petani\r\ntembakau dalam acara koordinasi stakeholder temkabau menghadapi musim tanam tahun 2021, Minggu,\r\n9 Mei 2021, di Pendopo Wahyawibawagraha. <o:p></o:p></span></p><p class=\"MsoNormal\">Bupati Hendy didampingi Sekretaris Daerah\r\nKabupaten Jember Mirfano, asisten, serta sejumlah kepala dinas dan kepala\r\nbagian di lingkungan Pemkab Jember.</p><p class=\"MsoNormal\">Hadir pula eksportir tembakau sebanyak 18\r\norang, perwakilan gabungan kelompok tani atau Gapoktan, serta Komisi Urusan\r\nTembakau Jember (KUTJ).<br></p><p class=\"MsoNormal\">Dalam sambutannya, bupati menyampaikan\r\nkemajuan bidang pertanian, terutama tembakau. Selain itu bupati Jember\r\nmenawarkan kepada PT Gudang Garam untuk mendirikan Pabrik Gudang Garam di\r\nJember.<br></p><p class=\"MsoNormal\">Menurutnya, jika ada pembangunan tersebut,\r\nKabupaten Jember akan menjadi kota industri. Dampaknya akan membuat\r\nkesejahteraan kehidupan di Jember dan mengurangi angka pengangguran serta\r\nkemiskinan.<br></p><p class=\"MsoNormal\">Menurut bupati, hingga saat ini Jember\r\ntelah menghasilkan tembakau terbaik di Indonesia dan dunia. Bahkan menjadi\r\npenghasil tembakau terbesar di Indonesia.<br></p><p class=\"MsoNormal\">\"Kita harus bangga, Jember sebagai\r\nkota pengahasil tembakau terbaik di Indonesia bahkan dunia, kata Bupati Hendy.<br></p><p class=\"MsoNormal\">Secara letak geografis, lanjutnya, Jember\r\nsangat cocok untuk ditanamin tembakau, sehingga hasil tembakau di Jember sangat\r\nmelimpah dan telah diekspor ke berbagai negara.<br></p><p class=\"MsoNormal\">Bupati menegaskan Pemkab Jember akan\r\nmemfasilitasi anggaran serta manajemen pertanian terutama petani tembakau di\r\nJember untuk lebih memajukan petani, terutama petani tembakau dapat\r\ndiuntungkan. (<b>sa/aif</b>)<br></p>','xZYUNZCH7a8hVyWMf2wPVwEUD8hUMF02dYspTmYvLnQqapXsicCyM3qwga4O.jpeg','2021-05-09 09:26:43','2021-05-16 20:11:59',9,NULL,NULL),(76,13,'2021-05-09','Berita','Koordinasi Stakeholder Tembakau Menghadapi Musim Tanam Tahun 2021','<p class=\"MsoNormal\"><b>Diskominfo Jember</b><span lang=\"EN-US\"> - Bupati Jember Hendy Siswanto mengundang pengusaha dan petani\r\ntembakau dalam acara koordinasi stakeholder menghadapi musim tanam tahun 2021, Minggu,\r\n9 Mei 2021, di Pendopo Wahyawibawagraha. <o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Bupati Hendy didampingi Sekretaris Daerah\r\nKabupaten Jember Mirfano, asisten, serta sejumlah kepala dinas dan kepala\r\nbagian di lingkungan Pemkab Jember.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Hadir pula eksportir tembakau sebanyak 18\r\norang, perwakilan gabungan kelompok tani atau Gapoktan, serta Komisi Urusan\r\nTembakau Jember (KUTJ).<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Dalam sambutannya, bupati menyampaikan\r\nkemajuan bidang pertanian, terutama tembakau. Selain itu bupati Jember\r\nmenawarkan kepada PT Gudang Garam untuk mendirikan Pabrik Gudang Garam di\r\nJember. <o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Menurutnya, jika ada pembangunan tersebut,\r\nKabupaten Jember akan menjadi kota industri. Dampaknya akan membuat\r\nkesejahteraan kehidupan di Jember dan mengurangi angka pengangguran serta\r\nkemiskinan. <o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Menurut bupati, hingga saat ini Jember\r\ntelah menghasilkan tembakau terbaik di Indonesia dan dunia. Bahkan menjadi\r\npenghasil tembakau terbesar di Indonesia. <o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">\"Kita harus bangga, Jember sebagai\r\nkota pengahasil tembakau terbaik di Indonesia bahkan dunia, kata Bupati Hendy.\r\n<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Secara letak geografis, lanjutnya, Jember\r\nsangat cocok untuk ditanamin tembakau, sehingga hasil tembakau di Jember sangat\r\nmelimpah dan telah diekspor ke berbagai negara.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span lang=\"EN-US\">Bupati menegaskan Pemkab Jember akan\r\nmemfasilitasi anggaran serta manajemen pertanian terutama petani tembakau di\r\nJember untuk lebih memajukan petani, terutama petani tembakau dapat\r\ndiuntungkan. (<b>sa/aif</b>)<o:p></o:p></span></p>','ZvfmRByXD1epF1hw1F3As8TtQQ49xeIZngvWuuDPsHJWMYkDKQMN4J0ztrye.jpeg','2021-05-09 09:33:41','2021-05-10 22:11:14',15,NULL,NULL),(77,13,'2021-05-10','Berita','Bupati Sidak Pertokoan Pastikan Prokes Berjalan','<p class=\"MsoNormal\"><b>Diskominfo Jember</b><span lang=\"EN-US\"> Bupati Jember Hendy Siswanto bersama Satgas Covid-19 melakukan\r\nsidak ke pusat perbelanjaan, Senin, 10 Mei 2021. Ini untuk memastikan protokol kesehatan\r\nberjalan di tempat publik.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Harus diantisipasi bersama, pesan bupati\r\nusai sidak di Toko Jadi Fashion di Talangsari, Kelurahan Jember Kidul,\r\nKaliwates.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Selain penerapan prokes oleh pemilik\r\ntoko, bupati menerangkan, petugas dari Satgas Covid-19 Kabupaten Jember juga berjaga di pertokoan.\r\n<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Merespon pertanyaan wartawan soal keluhan\r\npengusaha wisata akibat penutupan, Bupati Hendy menjelaskan bahwa ada perbedaan perilaku pengunjung.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Di tempat wisata, pengunjung lebih\r\ncenderung untuk berkerumun begitu berada di dalam tempat wisata. Berbeda dengan\r\ntempat belanja yang berlalu lalang kemudian keluar.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Di situ (tempat wisata, red) berkerumunnya\r\nagak lama. Kalau di sini (pertokoan) bergerak, langsung keluar pulang, urainya.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Hal sama terjadi di tempat ibadah. Menurut Bupati\r\nHendy, jamaah yang datang cenderung agak lama di dalam tempat ibadah.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Sidak dilakukan di pertokoan Roxy, Lippo,\r\ndan Jadi Fashion. Dari sidak tersebut bupati sementara berkesimpulan prokes\r\nberjalan.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Sementara itu, CEO Toko Jadi Fashion Hadi\r\nSusanto mengaku kedatangan bupati mengecek protokol kesehatan. Beliau juga mengingatkan\r\nkami agar memperhatikan kerumunan, ujarnya.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Sebagai pengusaha, pihaknya akan memenuhi\r\nketentuan tersebut. Caranya, saat ramai, mobil tidak boleh masuk halaman\r\nparkir. <o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Serta pembatasan pengunjung yang masuk di\r\ndalam area toko. Sebelum yang keluar banyak, pengunjung baru belum boleh masuk.\r\n<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span lang=\"EN-US\">Keluar masuk harus seimbang, katanya. Kapasitas\r\ntoko sekitar 500 orang. Berarti pengunjung dibatasi 250 orang di dalam area\r\ntoko. (<b>aif</b>)<o:p></o:p></span></p>','cQKJdbJ1redbKwt0x6fAQsYOktgUq1LsMBSR0SNVHjvvVD2GN6jjFeYkUl8Q.jpeg','2021-05-10 08:36:32','2021-05-15 10:57:07',5,NULL,NULL),(78,13,'2021-05-11','Berita','Dharma Wanita Persatuan Berikan Sembako untuk Masyarakat Kurang Beruntung','<span lang=\"EN-US\" style=\"font-size:11.0pt;line-height:107%;\r\nfont-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\"></span><p><b><span lang=\"EN-US\" style=\"font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">Diskominfo\r\nJember</span></b>&nbsp;- Dharma Wanita Persatuan (DWP) Kabupaten Jember bekerja sama dengan sejumlah organisasi wanita lain memberikan sembako kepada masyarakat yang kurang beruntung, Senin, 10 Mei 2021, di Aula Dharma Wanita Pemkab Jember.&nbsp;<br></p><p>Organisasi wanita lain yang tergabung dalam acara tersebut diantaranya Perwira, KCBI, IWABRI (Ikatan Wanita Perbankan BRI),&nbsp; Ikatan Karyawan Bank Jatim, dan organisasi wanita lainnya.<br></p><p>Acara tersebut dipimpin langsung Ketua Dharma Wanita Persatuan Iriane Mirfano. Menurutnya, di bulan Ramadhan yang penuh barokah, DWP mendapat kesempatan berbagi dengan saudara-saudara yang kurang beruntung.&nbsp;<br></p><p>Saudara-saudara yang kurang beruntung berhak mendapatkan bantuan,\" kata Iriane Mirfano.<br></p><p>Dalam sambutannya, Iriane menyampaikan laporan penyelenggaraan kegiatan itu. Dijelaskannya, pembagian sembako itu adalah program kerja Bidang&nbsp; Sosial Budaya DWP setiap tahun.<br></p><p>Dana yang terkumpul berasal dari iuran sukarela pengurus DWP, Ketua serta donasi dari para donatur dari organisasi wanita lain.&nbsp;<br></p><p>Adanya program pembagian sembako ini, banyak masyarakat yang terbantu dan termudahkan menjelang Hari Raya Idul Fitri 1442 Hijriyah, katanya.<br></p><p>Dalam pelaksanaan kegiatan tersebut, tim panitia beserta masyarakat tetap mematuhi protokol kesehatan. Mengurangi kerumunan saat pembagian sembako, dengan cara pembagian bertahap sesuai nomor kupon dan waktu yang berbeda.<br></p><p>Menurut Iriane Mirfano, sasaran pemberian sembako adalah masyarakat yang kurang beruntung. Seperti kaum duafa, anak yatim, masyarakat kurang mampu, beserta ojek online. Jumlahnya 200 orang.<br></p><p>Ke depannya, sesuai dengan arahan Ibu Kasih Fajarini selaku Penasehat Dhama Wanita Persatuan Kabupaten Jember, diharapkan supaya lakan lebih banyak komunitas yang bergabung dalam organisasi ini dan target masyarakat yang disantuni lebih banyak lagi, tuturnya. (<b><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">sa/aif</span></b>)<br></p>','wkVLr1sb8WvBGdttbYU1ny4hdaXkT356qxZuw3zE5kDSdEH7bNdMokmGz3pn.jpeg','2021-05-11 05:24:54','2021-05-17 01:50:44',49,NULL,NULL),(79,13,'2021-05-11','Berita','Apel Jelang Libur Idul Fitri, Asisten Perekonomian Tegaskan Larangan Mudik','<p class=\"MsoNormal\"><b>Diskominfo Jember</b><span lang=\"EN-US\">  Asisten Perekonomian Dedi Nurahmadi saat apel di depan Kantor\r\nBupati Jember, Senin, 10 Mei 2021, menegaskan aparatur sipil negara (ASN)\r\ndilarang mudik.</span><br></p><p class=\"MsoNormal\">Apel ini bersama-sama kita laksanakan\r\nsebagai upaya mendisiplinkan diri sebagai ASN, terang Dedi Nurrahmadi yang\r\nmenjadi pembina apel.</p><p class=\"MsoNormal\">Terlebih beberapa hari lagi kita akan\r\nmerayakan Hari Raya Idul Fitri. Sesuai instruksi dari Bapak Bupati bahwa ASN\r\ntidak boleh melaksanakan mudik, tambahnya.</p><p class=\"MsoNormal\">Apel itu diikuti PNS dan Non PNS di\r\nlingkungan kantor Pemkab Jember. Baik Sekretariat, Bappekab, BPKAD,\r\nInspektorat, Satpol PP, BKPSDM, Dispora, PTSP, Disnaker, Dishub dan Diskominfo.<br></p><p class=\"MsoNormal\">Hadir pula para Staf Ahli Bupati Jember,\r\nAsisten, Sekda, Inspektur, Kepala Satpol-PP, Sekretaris DPRD, Direktur RSD dr\r\nSoebandi, RSD Kalisat dan RSD Balung.<br></p><p class=\"MsoNormal\">Selain menegaskan larangan mudik, Dedi\r\nNurrahmadi menyampaikan bahwa mengenai ketentuan libur bagi karyawan/ karyawati\r\nmulai tanggal 12-16 Mei 2021.<br></p><p class=\"MsoNormal\">Dan pada saat hari libur, Dedi Nurrahmadi\r\nmengimbau para karyawan/ karyawati agar tidak merayakan dengan berlebihan.<br></p><p class=\"MsoNormal\">Jangan terlalu euforia merayakan liburan,\r\nkarena yang ditakutkan terjadi klaster baru, tegasnya.<br></p><p class=\"MsoNormal\">Tetap jaga kesehatan dan gunakan protokol\r\nkesehatan ketat sebagai upaya saling memutus mata rantai Covid-19, tutupnya. (<b>mar/aif</b>)<br></p>','ZmBmb7APniniUW2o69r5raPF0HWqeZgeizM9Ki2zlfdmtnkGRnJGA8NNmJ0c.jpeg','2021-05-11 05:29:24','2021-05-17 00:13:22',30,NULL,NULL),(80,13,'2021-05-11','Berita','Bupati Dukung Kelompok Arisan Bhineka Gelar Santunan Anak Yatim','<p>Diskominfo Jember - Menjelang Hari Raya Idul Fitri 1442 Hijriyah, kelompok arisan Bhineka Kabupaten Jember memberikan santunan kepada anak yatim piatu di Pendopo Wahyawibawagraha, Selasa, 11 Mei 2021.<br></p><p>Acara tersebut dihadiri langsung oleh Bupati Jember Hendy Siswanto beserta Ketua TP PKK Jember Kasih Fajarini dan Wakil Ketua PKK Ervita Afdilah Sari. Hadir pula Ketua Dharma Wanita Persatuan Iriane Mirfano dan beberapa tamu undangan.</p><p>Dalam sambutannya, Bupati Hendy menyampaikan dukungan kegiatan santunan anak yatim piatu oleh kelompok arisan Bhineka Kabupaten Jember.&nbsp;</p><p>Bupati juga menjelaskan bahwa dana yang terkumpul untuk santunan anak yatim piatu berasal dari iuran, donatur, serta bantuan dari stakeholder.</p><p>Saya mengucapkan banyak terima kasih kepada para donatur dan stakeholder untuk kesuksesan acara ini, ungkap Bupati Hendy.</p><p>Dalam kesempatan yang sama, Kasih Fajarini menyampaikan keinginannya untuk mengadakan acara santunan anak yatim piatu bisa dilaksanakan setiap bulan, tidak hanya bulan Ramadhan saja.&nbsp;</p><p>Saya ingin acara santunan ini dilaksanakan setiap bulan dan terus bertambah targetnya, ungkapnya.</p><p>Acara santunan anak yatim tersebut telah dilaksanakan setiap tahun dan menjadi program kegiatan kelompok arisan Bhineka Kabupaten Jember menjelang Hari Raya Idul Fitri 1442 H.&nbsp;</p><p>Santunan yang dibagikan berupa sembako, kue kering, dan sejumlah uang. Acara tersebut ditutup dengan foto bersama. (sa/aif)</p>','9QpY2IBVhwpwFiQEmBemwuZEeStwUKL57PQoRje8Ywf6eN3eCgxIYo1D6Zkq.jpeg','2021-05-11 13:41:49','2021-05-17 01:15:45',17,NULL,NULL),(82,13,'2021-05-11','Berita','Sidak Pasar, Bupati Hendy : Kenaikan Harga Wajar','<p class=\"MsoNormal\"><b>Diskominfo Jember</b><span lang=\"EN-US\">  Bupati dan Wakil Bupati Jember, Hendy Siswanto dan MB Firjaun\r\nBarlaman, menggelar inspeksi mendadak atau sidak di pasar untuk mengetahui\r\nharga pangan mendekati Hari Raya Idul Fitri 2021.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Sidak pada Selasa, 11 Mei 2021, itu\r\ndilakukan di dua pasar besar di wilayah perkotaan, yakni Pasar Tanjung dan\r\nMangli.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Harga naik sedikit, ungkap Bupati Hendy\r\nkepada wartawan di Pasar Mangli.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Menurut bupati, kenaikan tersebut dinilai\r\nmasih wajar. Terlebih pada hari-hari mendekati Hari Raya Idul Fitri. <o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Di sisi pembeli, bupati menerangkan,\r\nmengalami sedikit kenaikan dibanding bulan Ramadhan tahun lalu, yang juga pada\r\nmasa pandemi Covid-19.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Tahun kemarin kan kita tidak boleh ke\r\npasar, pasar tutup. Pas hari lebaran dibatasi. Tapi pada tahun ini kan sudah terbuka,\r\ntetapi standar prokes harus dilakukan. Di Pasar Tanjung dan Pasar Mangli semua\r\npakai masker, tidak ada kerumunan, semua mengalir,\" urai bupati.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Dari pantauan di dua pasar itu, bupati\r\nmelihat pedagang memakai masker serta tidak terjadi kerumunan. Pembeli tidak\r\nsampai berkerumun lama atau mengalir.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Dari sidak itu juga ditemukan adanya\r\nkenaikan konsumsi daging sapi, terutama di Pasar Mangli. Di pasar itu naik\r\nhingga dua ton. <o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Hal itu terjadi karena adanya sistem\r\narisan. Pembelinya itu yang ikut arisan daging. Jadi nyicil setahun. Itu yang\r\ndiambil, ungkapnya.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span lang=\"EN-US\">Dalam kesempatan itu, bupati juga\r\nmenyatakan akan melakukan kajian terhadap kondisi pasar yang ada saat ini untuk\r\nLangkah perbaikan ke depannya. (<b>aif</b>)<o:p></o:p></span></p>','Lk8LGA0wrvlWIotFzvtS7yvOGHh60hH2FFWh0Ke08CRx4j5p3g4Se9EvbRxn.jpeg','2021-05-11 23:31:28','2021-05-15 20:34:44',20,NULL,NULL),(83,13,'2021-05-11','Berita','Sosialisasikan SE Gubernur Jatim terkait Sholat Idul Fitri 1442 H','<p class=\"MsoNormal\"><b>Diskominfo Jember</b><span lang=\"EN-US\">  Pemerintah Kabupaten Jember menggelar sosialisasi Surat Edaran\r\n(SE) Gubernur Jawa Timur tentang penyelenggaraan sholat Idul Fitri 1442\r\nHijriyah di saat masa pandemi Covid-19.</span><br></p><p class=\"MsoNormal\">Sosialisasi yang berlangsung di Pendopo\r\nWahyawibawagraha, Senin, 10 Mei 2021, itu diikuti oleh Dewan Masjid Indonesia\r\n(DMI) Jember serta sejumlah takmir masjid di Kabupaten Jember.<br></p><p class=\"MsoNormal\">Kami ingin menyampaikan perintah dari\r\nKemenag dan Gubernur Jawa Timur mengenai sholat Idul Fitri di masa pandemi,\r\nterang Bupati Jember Hendy Siswanto saat membuka acara sosialisasi itu.<br></p><p class=\"MsoNormal\">Tahun 2021 merupakan perayaan kedua Hari\r\nRaya Idul Fitri pada masa pandemi. Dalam kondisi ini, Bupati Hendy mengajak\r\nmasyarakat Jember untuk sabar dan tabah menghadapinya.<br></p><p class=\"MsoNormal\">Maka dari itu, kita harus berikhtiar untuk\r\nmelawan pandemi ini dengan melaksanakan aturan-aturan yang telah dibuat oleh\r\npemerintah, jelasnya.<br></p><p class=\"MsoNormal\">Sesuai aturan dalam SE Gubernur Jatim,\r\nbupati menerangkan, masyarakat Jember dapat melaksanakan sholat ied dengan\r\nketentuan tidak lebih dari 15 persen dari kapasitas tempat ibadah.<br></p><p class=\"MsoNormal\">Hal tersebut berdasarkan kriteria zonasi\r\npengendalian wilayah hingga tingkat RT, seperti diatur dalam PPKM (Pemberlakuan\r\nPembatasan Kegiatan Masyarakat) skala mikro.<br></p><p class=\"MsoNormal\">Jember per hari ini tergolong masuk zona\r\noranye. Secara aturan dapat melakukan sholat ied, ungkap bupati. Meski\r\ndemikian, pelaksanaan sholat ied harus sesuai SE Gubernur Jatim.<br></p><p class=\"MsoNormal\">Dalam SE itu menjelaskan kriteria zonasi\r\nwilayah yang dapat atau tidak melaksanakan sholat ied. Bagi zona merah hanya\r\nboleh dilakukan di rumah masing-masing.<br></p><p class=\"MsoNormal\">Zona oranye dapat melakukan di masjid atau\r\nmushollah, namun hanya 15 persen. Dan zona kuning dan hijau sebanyak 50 persen.\r\n(<b>mar/aif</b>)<br></p>','RyD9YmIiaJJzyJZPG0F5dpZdbjp9rieKZcHHllHdZC9rEUxCBvOAMpumPsIo.jpeg','2021-05-11 23:35:56','2021-05-14 00:14:35',8,NULL,NULL);
